namespace Pyro\IdeHelper\Examples;

use Anomaly\Streams\Platform\Ui\Icon\IconRegistry;

class IconExamples
{
    public static function addTo(&$var, $key = 'icon', array $icons = null)
    {
        $icons = $icons ?? static::all();
        foreach ($icons as $icon) {
            $var[ $key ] = $icon;
        }
        return $var;
    }

    public static function mergeWith(array $array)
    {
        foreach (static::all() as $icon) {
            $array[ 'icon' ] = $icon;
        }
        return $array;
    }

    public static function all()
    {
        return array_merge(
            static::registry(),
            static::fontAwesome(),
            static::materialDesign(),
        );
    }

    public static function registry()
    {
        $icons = (new IconRegistry)->getIcons();
        return array_keys($icons);
    }

